('1573','18','7433','Villa Graf von Brühl',Null,'Meerblick-Villa in exponierter Lage in  Cas Català ','15309','Diese sehr gepflegte Villa steht auf einem ca. 1.033 m² großen Hanggrundstück in ruhiger Lage von Cas Català. Von hier aus sind es nur wenige Fahrminuten zur lebendigen Inselhauptstadt Palma. Von der Poolebene aus erreicht man ein Gästeapartment mit Wohnzimmer, Schlafzimmer, Bad und Sauna.\r\nIm 1. OG betritt man die Wohnebene mit Wohn-Esszimmer, Wintergarten, Bibliothek, Küche, Gästetoilette und einem Schlafzimmer mit Ankleide sowie Badezimmer.\r\nIm 2. OG erreicht man über eine offene Galerie drei weitere Schlafzimmer (teilweise mit Terrasse) mit je einer Ankleide und einem Bad en suite. \r\nDie Villa ist hochwertig ausgestattet wie z.B. Gaggenau – und Miele Geräten in der Küche, Öl-Zentralheizung, Alarmanlage, Musikanlage in allen Zimmern, Außenlift, in ein Hallenbad verwandelbarer Swimmingpool u.v.m. Die geräumige Garage bietet Platz für 4-5 Autos. Von allen Ebenen aus genießen Sie einen sehr schönen Meerblick.','15310','2900000','111','2011-05-24 16:16:47','106','2011-05-24 16:17:37',Null,'987','83','496',1,'1','0',Null,Null,Null,'15311',Null,'0','0','0',Null,'2016-03-03 11:46:02',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'15312',Null,'15313',Null,'15314',Null,'15315','Dany 617.705.928','15316','0',0,'0');
